import {useState} from "react";

const Button = () => {
   const [countries, setCountries] = useState([]);
  return (
   countries.map((country, i) =>
            <li key={i}> {country.name} <button onClick={() => setCountries([country])}>show</button></li>
          )
  )
}

export default Button;
